import React, { useState } from "react";
import axios, { Axios } from "axios";

const SetSelect  = () => {

    const [set, setSetName] = useState()

    axios.get("https://api.scryfall.com/sets")
    .then(res => {
        const sets = res.data;
        this.setState({ sets })
    })


    return(
        <ul>
            {
                this.state.sets
                .map(sets => 
                    <li key = {sets.name}> </li>)
            }
        </ul>
    )
}

export default SetSelect
